import React from 'react';
import './App.css';
import {
Container,
Images,
Col,
}from "reactstrap"; 

function App() {
  return (
    <Container>
  <Row>
    <Col xs={6} md={4}>
      <Image src="holder.js/171x180" rounded />
    </Col>
    <Col xs={6} md={4}>
      <Image src="holder.js/171x180" roundedCircle />
    </Col>
    <Col xs={6} md={4}>
      <Image src="holder.js/171x180" thumbnail />
    </Col>
  </Row>
</Container>
  );
}

export default App;
